var objZip = new JSZip();
var counter = 0;
var arrTrueRows = [];
var arrErrors = [];
var start;
const regPrice = /^\d+$|^\d+[\.,]{1}\d{1,2}$/;
const regPriceFrom = /^Ціна\sвід/i;
const regFileNameSymbols = /[\\/:\*\?"\<\>\|]/g;
let objTable = jspreadsheet(document.getElementById("spreadsheet"), {
	minDimensions: [2, 10],
	columns: [
		{ type: "text", title: "Текст чи посилання для коду", width: 450 },
		{ type: "text", title: "Ціна", width: 150 },
	],
});
var arrPrUrlPreloaded = [];
document.getElementById("runScript").addEventListener("click", function () {
    var intRow=0;
	start = new Date();
	objZip.files = {};
	arrTrueRows = [];
	arrErrors = [];
	document.getElementById("showErrors").innerHTML = "";
	document.getElementById("downloadZip").classList.add("d-none");
	let objTableData = objTable.getData();
	objTableData.forEach(function (item, i, arr) {
		if (item[0] == "" && item[1] == "") return;
		if (item[1] == "")  showErrors("Рядок №<strong>" + (i + 1) + "</strong>: значення ціни не вказано, ціну <strong>не буде сгенеровано</strong>.");
		if (item[1] !== "" && !regPrice.test(item[1])) showErrors("Рядок №<strong>" + (i + 1) + "</strong>: значення нової ціни не пройшло перевірку,  ціну <strong>не буде сгенеровано</strong>.");
		arrTrueRows.push(i);
	});
	if (arrTrueRows.length == 0) return showErrors("Дані в табліці не заповнені!");
	if (arrErrors.length > 0 && !window.confirm("В таблиці є помилки! Все одно продовжити?")) return;
	document.getElementById("runScript").setAttribute("disabled", "");
	runProgressBar(counter, arrTrueRows.length);
	changeContent((objTemplate,objTableData,intRow)=>{
        generatePictogram(objTemplate, objTableData, intRow);
    },objTableData,intRow);
});
function generatePictogram(objTemplate, objTableData, row) {
	html2canvas(objTemplate, { backgroundColor: null, useCORS: true }).then((canvas) => {
		let strPNG = canvas.toDataURL("image/png");
		let strFileName = "no-name-row-" + (row * 1 + 1);
		if (objTableData[row][0] !== ""){
            strFileName = row+" - "+objTableData[row][0];
        }else{
            strFileName = row.toString();
        }

		strFileName = strFileName.replace(regFileNameSymbols, "");
		objZip.file(strFileName + ".png", strPNG.split(",")[1], { base64: true });
		counter++;
		runProgressBar(counter, arrTrueRows.length);
		if (counter == arrTrueRows.length) {
			createZipFile();
			document.getElementById("runScript").removeAttribute("disabled");
			console.log((new Date() - start) / 1000 + " c");
			document.getElementById("downloadZip").classList.remove("d-none");
			document.getElementById("showProgress").innerHTML = "";
			return (counter = 0);
		}
		// objTemplate = changeContent(objTableData[arrTrueRows[counter]]);
		// generatePictogram(objTemplate, objTableData, [arrTrueRows[counter]]);
        row++;
        changeContent((objTemplate,objTableData,intRow)=>{
            generatePictogram(objTemplate, objTableData, intRow);
        },objTableData,row);
	});
}
function changeContent(_callback, objRowData, intRow) {
	let strName = objRowData[intRow][0];
    
	let strPrice = objRowData[intRow][1];
	let arrPrice = parsePrice(strPrice);

	if (arrPrice) {
		let objTemplate = document.getElementById("with-price");
        arrPrUrlPreloaded[intRow] = "https://chart.googleapis.com/chart?chld=H|4&chs=547x547&cht=qr&chl="+encodeURIComponent(strName);

        let preloaderImg = document.createElement("img");
        preloaderImg.src = arrPrUrlPreloaded[intRow];

        preloaderImg.onload = function () {
            objTemplate.style.backgroundImage = `url(${arrPrUrlPreloaded[intRow]})`;
            objTemplate.querySelector(".new__grn").innerHTML = arrPrice[0];
            objTemplate.querySelector(".new__cop").innerHTML = arrPrice[1];
            objTemplate.querySelector(".new__wrapper").style.fontSize = optimizeFontSize(objTemplate);

            
            _callback(objTemplate,objRowData,intRow);
        };
	} else {
        let objTemplate = document.getElementById("without-price");
        arrPrUrlPreloaded[intRow] = "https://chart.googleapis.com/chart?chld=L|4&chs=547x547&cht=qr&chl="+encodeURIComponent(strName);

        let preloaderImg = document.createElement("img");
        preloaderImg.src = arrPrUrlPreloaded[intRow];

        preloaderImg.onload = function () {
            objTemplate.style.backgroundImage = `url(${arrPrUrlPreloaded[intRow]})`;

            
            _callback(objTemplate,objRowData,intRow);
        };
	}
}
function parsePrice(str) {
	if (regPrice.test(str)) {
		let arrPrice = str.match(/(\d+)[\.,]?(\d+)?/);
		if (arrPrice !== null) {
			let strGrn = arrPrice[1];
			let strCop = arrPrice[2];
			if (strCop == undefined) strCop = "00";
			if (strCop.length == 1) strCop += "0";
			return [strGrn, strCop];
		}
	} else {
		return false;
	}
}
function optimizeFontSize(objTemplate) {
	objTemplate.querySelector(".new__wrapper").style.fontSize = "35px";
	let numWrapperWidth = objTemplate.querySelector(".new__wrapper").clientWidth;
	let numMaxWidth = 35;
	let numFontSize = 35;
	let numResult = parseInt((numMaxWidth / numWrapperWidth) * numFontSize);
	if (numResult >= 35) numResult = 35;
	return numResult + "px";
}
function createZipFile() {
	objZip.generateAsync({ type: "blob" }).then(function (blob) {
		saveAs(blob, "price-tags.zip");
	});
}
function showErrors(str) {
	let objErrorsWindow = document.getElementById("showErrors");
	if (objErrorsWindow.hasChildNodes()) {
		document.getElementById("showErrorsList").insertAdjacentHTML("beforeend", "<p>" + str + "</p>");
	} else {
		objErrorsWindow.innerHTML = '<div class="alert alert-danger alert-dismissible fade show" role="alert"><h4 class="alert-heading">Увага в таблиці є помилки!</h4><div id="showErrorsList"><p>' + str + '</p></div><button type="button" class="btn-close" data-bs-dismiss="alert" aria-label="Close"></button></div>';
	}
	arrErrors.push(str);
}
function runProgressBar(valueNow, valueMax) {
	let objProgressWindow = document.getElementById("showProgress");
	if (objProgressWindow.hasChildNodes()) {
		document.getElementById("showProgressWidth").style.width = (100 * valueNow) / valueMax + "%";
	} else {
		objProgressWindow.innerHTML = '<div class="pb-3"><div class="progress"><div class="progress-bar progress-bar-striped progress-bar-animated" id="showProgressWidth" role="progressbar" style="width: 0%"></div></div></div>';
	}
}
